import React from 'react'
import './App.css';
import {Input,Button} from './COMPONENT/Input'

function App() {
  const [input,setInput]=React.useState()

  const handleOnChange=(event:any)=>{
    setInput(event.target.value)
  }

  return (
    <div className="App">
       <p>INPUT VALUE {input}</p>
       INPUT 1<input onChange={handleOnChange}></input>
       INPUT 2<Input/>
       INPUT 3<Input/>
       <button>Pakshi</button>
       <Button name={'one'}>Pakshi 1</Button>
       <Button name={'two'}>Pallav</Button>
       <Button width={'400px'}>Nishith</Button>
    </div>
  );
}

export default App;
